import React, { useState, useEffect } from 'react';
import { Transition } from '@headlessui/react';
import sunset1 from '../image/sunset1.jpg';
import dslr from '../image/dslr.png';
import lighting from '../image/lighting.png';
import sound from '../image/sound.png';
import photoshop from '../image/photoshop.png';
import premiere from '../image/premiere.png';
import afterEffects from '../image/after-effects.png';
import lightroom from '../image/lightroom.png';
import producer from '../image/producer.png';
import director from '../image/director.png';
import scriptwriter from '../image/scriptwriter.png';
import continuity from '../image/continuity.png';

function Habilidades({ seccionAnimacion }) {
  const [isMobile, setIsMobile] = useState(window.innerWidth < 768);

  useEffect(() => {
    const handleResize = () => {
      setIsMobile(window.innerWidth < 768);
    };

    window.addEventListener('resize', handleResize);

    return () => {
      window.removeEventListener('resize', handleResize);
    };
  }, []);

  return (
    <>
      <Transition
        show={seccionAnimacion === 'Habilidades'}
        enter="transition ease-out duration-500"
        enterFrom="opacity-0 transform -translate-y-full"
        enterTo="opacity-100 transform translate-y-0"
        leave="transition ease-in duration-300"
        leaveFrom="opacity-100 transform translate-y-0"
        leaveTo="opacity-0 transform -translate-y-full"
      >
        <div
          id="Habilidades"
          className="h-full flex flex-col items-center justify-center bg-gradient-to-b from-indigo-800 to-purple-800 text-white"
          style={{
            backgroundImage: `linear-gradient(rgba(0, 0, 0, 0.6), rgba(0, 0, 0, 0.9)), url(${sunset1})`,
            backgroundSize: 'cover',
            backgroundPosition: 'center',
            minHeight: '100vh',
          }}
        >
          <div className="grid grid-cols-1 md:grid-cols-2 gap-8 max-w-5xl w-full px-8">
            <div className={`flex flex-col items-center p-2 md:p-0 ${isMobile ? 'mt-12' : ''}`}>
              <h3 className="text-lg md:text-xl lg:text-2xl font-bold mb-4">Técnicas de Producción</h3>
              <div className="flex flex-wrap justify-center space-x-2 md:space-x-4 md:justify-start">
                <div className="w-20 h-20 md:w-24 md:h-24">
                  <img src={dslr} alt="DSLR Camera" className="w-full h-full object-contain p-2" />
                </div>
                <div className="w-20 h-20 md:w-24 md:h-24">
                  <img src={lighting} alt="Lighting Equipment" className="w-full h-full object-contain p-2" />
                </div>
                <div className="w-20 h-20 md:w-24 md:h-24">
                  <img src={sound} alt="Sound Equipment" className="w-full h-full object-contain p-2" />
                </div>
              </div>
            </div>
            <div className={`flex flex-col items-center p-2 md:p-0`}>
              <h3 className="text-lg md:text-xl lg:text-2xl font-bold mb-4">Software</h3>
              <div className="flex flex-wrap justify-center space-x-2 md:space-x-4 md:justify-start">
                <div className="w-20 h-20 md:w-24 md:h-24">
                  <img src={photoshop} alt="Photoshop Logo" className="w-full h-full object-contain p-2" />
                </div>
                <div className="w-20 h-20 md:w-24 md:h-24">
                  <img src={premiere} alt="Premiere Logo" className="w-full h-full object-contain p-2" />
                </div>
                <div className="w-20 h-20 md:w-24 md:h-24">
                  <img src={afterEffects} alt="After Effects Logo" className="w-full h-full object-contain p-2" />
                </div>
                <div className="w-20 h-20 md:w-24 md:h-24">
                  <img src={lightroom} alt="Lightroom Logo" className="w-full h-full object-contain p-2" />
                </div>
              </div>
            </div>
            <div className={`flex flex-col items-center p-2 md:p-0`}>
              <h3 className="text-lg md:text-xl lg:text-2xl font-bold mb-4">Roles en Producción</h3>
              <div className="flex flex-wrap justify-center space-x-2 md:space-x-4 md:justify-start">
                <div className="w-20 h-20 md:w-24 md:h-24">
                  <img src={producer} alt="Producer Logo" className="w-full h-full object-contain p-2" />
                </div>
                <div className="w-20 h-20 md:w-24 md:h-24">
                  <img src={director} alt="Director Logo" className="w-full h-full object-contain p-2" />
                </div>
                <div className="w-20 h-20 md:w-24 md:h-24">
                  <img src={scriptwriter} alt="Scriptwriter Logo" className="w-full h-full object-contain p-2" />
                </div>
                <div className="w-20 h-20 md:w-24 md:h-24">
                  <img src={continuity} alt="Continuity Logo" className="w-full h-full object-contain p-2" />
                </div>
              </div>
            </div>
          </div>
        </div>
      </Transition>
    </>
  );
}

export default Habilidades;
